css:
atom-text-editor,
:host {
  background-color: #080d12;
  color: #dedede;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #080d12;
  color: #dedede;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #0d1319;
  color: #dedede;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #dedede;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  color: #343434;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #343434;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #343434;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: #343434;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: #dedede;
}
atom-text-editor.is-focused .cursor,
:host(.is-focused) .cursor {
  border-color: #ffe792;
}
atom-text-editor.is-focused .selection .region,
:host(.is-focused) .selection .region {
  background-color: rgba(122, 163, 204, 0.21);
}
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line.cursor-line,
:host(.is-focused) .line-number.cursor-line-no-selection,
:host(.is-focused) .line.cursor-line {
  background-color: #0d1319;
}
.comment {
  color: #515c68;
}
.constant {
  color: #ffe792;
}
.entity {
  color: #3cadd7;
}
.keyword {
  font-weight: bold;
  color: #d7503c;
}
.storage {
  color: #dedede;
}
.storage.type {
  font-style: italic;
  color: #3cadd7;
}
.string {
  color: #bccc52;
}
.support {
  font-weight: bold;
  color: #ffe792;
}
.entity.name.class,
.entity.name.type.class,
.support.type,
.support.class {
  color: #e7c547;
}
.variable {
  font-weight: bold;
  color: #e6992e;
}
.invalid {
  color: #F8F8F8;
  background-color: #d7503c;
}
.text .source {
  background-color: rgba(176, 179, 186, 0.08);
}
.text.html.ruby .source {
  background-color: rgba(177, 179, 186, 0.13);
}
.entity.other.inherited-class {
  font-style: italic;
  color: #4abe95;
}
.string.quoted .source {
  color: #bccc52;
}
.string .constant {
  color: #bccc52;
}
.string.regexp {
  font-style: italic;
  color: #ffb454;
}
.string .variable {
  color: #ffe792;
}
.support.function {
  color: #d7503c;
}
.support.constant {
  color: #bccc52;
}
.other.preprocessor.c {
  color: #8996A8;
}
.other.preprocessor.c .entity {
  color: #AFC4DB;
}
.declaration.tag,
.declaration.tag .entity,
.meta.tag,
.meta.tag .entity {
  color: #3cadd7;
}
.meta.selector.css .entity.name.tag {
  color: #3cadd7;
}
.meta.selector.css .entity.other.attribute-name.id {
  font-weight: bold;
  color: #ffe792;
}
.meta.selector.css .entity.other.attribute-name.class {
  font-weight: bold;
  color: #bccc52;
}
.support.type.property-name.css {
  color: #dedede;
}
.meta.property-group .support.constant.property-value.css,
.meta.property-value .support.constant.property-value.css {
  font-style: italic;
  color: #bccc52;
}
.meta.preprocessor.at-rule .keyword.control.at-rule {
  font-weight: bold;
  color: #ffe792;
}
.meta.property-value .support.constant.named-color.css,
.meta.property-value .constant {
  color: #ffe792;
}
.meta.constructor.argument.css {
  color: #d7503c;
}
.meta.diff,
.meta.diff.header {
  font-style: italic;
  color: #F8F8F8;
  background-color: #233345;
}
.markup.deleted {
  color: #F8F8F8;
  background-color: #d7503c;
}
.markup.changed {
  color: #F8F8F8;
  background-color: #3cadd7;
}
.markup.inserted {
  color: #F8F8F8;
  background-color: #43ae88;
}
.sublimelinter.outline.notes {
  background-color: #233345;
}
.sublimelinter.outline.illegal {
  background-color: #d7503c;
}
.sublimelinter.underline.illegal {
  background-color: #d7503c;
}
.sublimelinter.outline.warning {
  color: #dedede;
  background-color: #9f3a2c;
}
.sublimelinter.underline.warning {
  background-color: #d7503c;
}
.sublimelinter.outline.violation {
  background-color: #9f3a2c;
}
.sublimelinter.underline.violation {
  background-color: #d7503c;
}
.entity.other.attribute-name.id.html {
  color: #e6992e;
}
.entity.other.attribute-name.html {
  font-weight: bold;
  color: #bccc52;
}
.punctuation.definition.tag.end,
.punctuation.definition.tag.begin,
.punctuation.definition.tag {
  color: #266b85;
}
.keyword.control.at-rule.import.css {
  font-weight: bold;
  color: #ffe792;
}
.variable.other.less {
  color: #dedede;
}
.entity.other.less.mixin {
  color: #dedede;
}
.source.css.less .keyword.unit.css {
  color: #bccc52;
}
.entity.other.attribute-name.angular.html,
.source.angular.embedded.html {
  color: #ffe792;
}
.constant.character.entity.html {
  color: #bccc52;
}
.variable.other.readwrite.instance.coffee {
  color: #bccc52;
}
.meta.brace.round.coffee,
.meta.brace.square.coffee {
  color: #ffe792;
}
.punctuation.section.embedded.coffee {
  color: #bccc52;
}
.variable.assignment.coffee .variable.assignment.coffee {
  color: #dedede;
}
.meta.delimiter.method.period.coffee {
  color: #3cadd7;
}
.meta.brace.curly.coffee {
  color: #bccc52;
}
.meta.tag.sgml.doctype.xml,
.declaration.sgml.html .declaration.doctype,
.declaration.sgml.html .declaration.doctype .entity,
.declaration.sgml.html .declaration.doctype .string,
.declaration.xml-processing,
.declaration.xml-processing .entity,
.declaration.xml-processing .string,
.doctype {
  color: #3c444d;
}
.markup.deleted.git_gutter {
  color: #d7503c;
}
.markup.inserted.git_gutter {
  color: #43ae88;
}
.markup.changed.git_gutter {
  color: #3cadd7;
}
.markup.ignored.git_gutter {
  color: #3e4751;
}
.markup.untracked.git_gutter {
  color: #3e4751;
}
.punctuation.definition.string.begin.json:not(.meta.structure.dictionary.value.json),
.punctuation.definition.string.end.json:not(.meta.structure.dictionary.value.json) {
  color: #dedede;
}
.meta.structure.dictionary.value.json .string.quoted.double.json {
  color: #ffe792;
}
